import CardView from './CardView';

const App = () => {
  return (
    <div>
      <CardView
        image="https://via.placeholder.com/300x200"
        title="Card Title"
        description="This is a card description."
      />
      <CardView
        image="https://via.placeholder.com/300x200"
        title="Card Title 2"
        description="This is another card description."
      />
    </div>
  );
};
